import React from 'react';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import TextField from '@mui/material/TextField';
import RoomIcon from '@mui/icons-material/Room';
import PhoneIcon from '@mui/icons-material/Phone';
import EmailIcon from '@mui/icons-material/Email'   ;

function TypographyExample() {
  const address = "Door No 4-12 C.R.K Puram Village Pathatekkali Post Vajrapukotturu Mandal Srikakulam District AP-532218.";
  const phone = '+91-7993609859';
  const email = 'sangaru.satti@gmail.com';
  return (
    <Container maxWidth="lg"> {/* Adjust max-width as needed */}
      <Grid container spacing={2}>
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h3">About Us</Typography>
              <Typography variant="body2" component="p">
                What is Lorem Ipsum? Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.  
              </Typography>

              <Typography variant="body1" color="textSecondary" gutterBottom style={{marginTop : '10px'}}>
                <RoomIcon color="disabled" /> {address}
              </Typography>

              <Typography variant="body1" color="textSecondary" gutterBottom style={{marginTop : '10px'}}>
                <PhoneIcon color="disabled" /> {phone}
              </Typography>

              <Typography variant="body1" color="textSecondary" gutterBottom style={{marginTop : '10px'}}>
                <EmailIcon color="disabled" /> {email}
              </Typography>

              <iframe src="https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d15550.23313155117!2d77.57411!3d13.000079949999998!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sin!4v1712743894319!5m2!1sen!2sin" width="400" height="300" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h2">Contact Us</Typography>
              <TextField
                label="Name"
                id="outlined-start-adornment"
                sx={{ m: 1, width: '25ch' }}
              />

              <TextField
                label="Email"
                id="outlined-start-adornment"
                sx={{ m: 1, width: '25ch' }}
              />

              <TextField
                label="Phone No."
                id="outlined-start-adornment"
                sx={{ m: 1, width: '25ch' }}
              />

              <TextField
                label="Alternative Phone No."
                id="outlined-start-adornment"
                sx={{ m: 1, width: '25ch' }}
              />

              <TextField
                id="outlined-multiline-flexible"
                label="Description"
                multiline
                maxRows={4}
              />

            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Container>
  );
}

export default TypographyExample;
